import React from 'react';
import './Login.css'

const Login = () => {
  return (
    <>
    <div className='loginContainer'>
        <h1>Login</h1>
        <label>Username</label>
        <input></input>
        <label>Passoword</label>
        <input></input>
        <span>Forgot Passowrd ?</span>
        <button>Login</button>
        <span>Don't have an account ? Register</span>
    </div>
      
    </>
  );
}

export default Login;
